import React from "react";

const navigation = [
  { name: "Home", href: "#", current: true },
  { name: "About", href: "#", current: false },
  { name: "Presentation", href: "#", current: false },
  { name: "Contact", href: "#", current: false },
];

const Navbar = () => {
  return <></>;
};

export default Navbar;
